/* 执行函数 */
$(function(){
    var objDom = {
        window: $(window), navhover: $('.nav-main a'), curPage: $('#cur-page li'), module: $('.section'), maxImg: $('.ma-img img'), maText: $('.ma-text'), donwBtn: $('.load-btn'), mbText: $('.mb-text'), mbImga: $('.mb-imga'), mbImgb: $('.mb-imgb'), mcText: $('.mc-text'), mcList: $('.mc-list'), mdText: $('.md-text'), loadBtnFooter: $('.load-btn-footer')
    };
    $.fn.fullpage({
        anchors: ['index1', 'index2', 'index3', 'index4'],
        menu: '#menu',
        afterLoad: function(anchorLink,index){
            if(isCSS('animation')){
                objDom.module.removeClass('animated');
                objDom.module.eq(index-1).addClass('animated');
            }
        },
        afterRender: function(){
            if(isCSS('animation')){
                objDom.module.eq(0).addClass('animated');
            }else{
                objDom.module.find('div,ul,a').show();
            }
        },
        scrollingSpeed: 500,
        navigation: false,
        keyboardScrolling: true
    });
    objDom.navhover.hover(function(){
        $(this).find("i").addClass('nav-hover');
    },function(){
        $(this).find("i").removeClass('nav-hover');
    });
    if(objDom.window.width()>768){
        windowAdapter.height(objDom);
        objDom.window.on('resize',function(){
            windowAdapter.height(objDom);
        });
    }
    windowAdapter.staJS(objDom);
});